apiVersion: v1
kind: Namespace
metadata:
  name: kubestronaut
---
apiVersion: v1
kind: ConfigMap
metadata:
  name: kubestronaut-html
  namespace: kubestronaut
data:
  index.html: |
    <!DOCTYPE html>
    <html>
    <head>
      <title>Kubestronaut</title>
    </head>
    <body style="text-align: center; padding-top: 100px;">
      <h1>üöÄ Welcome to Kubestronaut!</h1>
      <p>ÁèæÂú®ÊôÇÈñìÔºö$(date)</p>
      <p>ÊôÇÂçÄÔºö$(date +'%Z %z')</p>
      <img src="/Kubestronaut.png" alt="Kubestronaut Logo" width="300"/>
    </body>
    </html>
---
apiVersion: v1
kind: ConfigMap
metadata:
  name: kubestronaut-image
  namespace: kubestronaut
binaryData:
  Kubestronaut.png: 
---
apiVersion: apps/v1
kind: Deployment
metadata:
  name: kubestronaut-nginx
  namespace: kubestronaut
spec:
  replicas: 1
  selector:
    matchLabels:
      app: kubestronaut
  template:
    metadata:
      labels:
        app: kubestronaut
    spec:
      containers:
        - name: nginx
          image: nginx:alpine
          ports:
            - containerPort: 80
          volumeMounts:
            - name: html
              mountPath: /usr/share/nginx/html/index.html
              subPath: index.html
            - name: image
              mountPath: /usr/share/nginx/html/Kubestronaut.png
              subPath: Kubestronaut.png
      volumes:
        - name: html
          configMap:
            name: kubestronaut-html
        - name: image
          configMap:
            name: kubestronaut-image
---
apiVersion: v1
kind: Service
metadata:
  name: nginx
  namespace: kubestronaut
spec:
  type: NodePort
  selector:
    app: kubestronaut
  ports:
    - port: 80
      targetPort: 80
      nodePort: 30088
---
apiVersion: networking.k8s.io/v1
kind: Ingress
metadata:
  name: kubestronaut-ingress
  namespace: kubestronaut
  annotations:
    nginx.ingress.kubernetes.io/rewrite-target: /
spec:
  ingressClassName: nginx
  rules:
    - host: kubestronaut.local
      http:
        paths:
          - path: /
            pathType: Prefix
            backend:
              service:
                name: nginx
                port:
                  number: 80
